import React from "react";
import './Case.css';

const Case = () => {
  return (
    <div>
      <div className="titleCase">Кейсы</div>
      <div className="textCase">
        Показываем процесс работы изнутри, делимся результатами, опытом,
        полезными фишками
      </div>
    </div>
  );
};
export default Case;
